class App extends Component {
	render(){

		const headstyle = {
			paddingTop:'20px',
			paddingBottom:'20px',
			color:'#917eb3'
		}

	return (
	    <div className="App">
	     <Header />
	     // <Slider />
	     <Banner />
	     <Services />
	     <Story />
	     <Showcase />
	     <Footer />
	    </div>
	  );

	}
}

export default App;
